import React, { useState } from "react";

function ShowData({data}) {
    console.log("Inside Show Data-",data);
    return(
    <div>
      <h1>Anime List</h1>
      <ul>
        {data.map((anime) => (
          <li key={anime.id}>
            <h2>{anime.title}</h2>
            <p>ID: {anime.id}</p>
            <p>Route: {anime.route}</p>
            <p>Premier: {anime.premier}</p>
            {/* Add more properties as needed */}
          </li>
        ))}
      </ul>
    </div>
    );
}

export default ShowData;
